import React from 'react'
import '../styling/BackCard.css'
import '../styling/FrontCard.css'
import AndroidOutlinedIcon from '@material-ui/icons/AndroidOutlined';
import PanToolTwoToneIcon from '@material-ui/icons/PanToolTwoTone';
import { makeStyles } from '@material-ui/core/styles';
import Avatar from '@material-ui/core/Avatar';
import { deepOrange } from '@material-ui/core/colors';
import ContactSupportOutlinedIcon from '@material-ui/icons/ContactSupportOutlined';
import QuestionAnswerRoundedIcon from '@material-ui/icons/QuestionAnswerRounded';
import FiberManualRecordTwoToneIcon from '@material-ui/icons/FiberManualRecordTwoTone';

const useStyles = makeStyles((theme) => ({
  avatar: {
    color: theme.palette.getContrastText(deepOrange[500]),
    backgroundColor: deepOrange[400],
    border: `1px solid`,
   marginTop:'1vh',


    position:'absolute'
 },

}));








const BackCard = () => {
    const classes = useStyles();


    return (

        <div className='background-container'>

            <div className='backCard-container'  >

                <div className='backCard-text'>

                    <h1>IRIS</h1>
                    <h2>Hello <PanToolTwoToneIcon/></h2>
                    <h3>I am Iris, a Virtual Assistance</h3>
                    <h3>How may I help you?</h3>


                <Avatar className={classes.avatar}  >
                        <AndroidOutlinedIcon/>
                    </Avatar>




                </div>



            <div className='frontCard-container'>



              <div className='frontCard-text'>
                    <h4>Frequently Asked Questions <ContactSupportOutlinedIcon style={{fill:'rgb(255, 116, 51'}}/></h4>
                    <div className='question-container'>
                    <div className=''>
                    <div><FiberManualRecordTwoToneIcon style={{fill:'rgb(255, 116, 51'}} fontSize='small'/>Can I redeem my FB before the original term?</div>
                    <div><FiberManualRecordTwoToneIcon style={{fill:'rgb(255, 116, 51'}} fontSize='small'/>How do I pay my Credit card bill?</div>
                    <div><FiberManualRecordTwoToneIcon style={{fill:'rgb(255, 116, 51'}} fontSize='small'/>How can I get my Account Statement?</div>
                    <div><FiberManualRecordTwoToneIcon style={{fill:'rgb(255, 116, 51'}} fontSize='small'/>What is the tenure of Fixed Deposit?</div>
                    <div className='msg-Btn'><QuestionAnswerRoundedIcon style={{fill:'rgb(207, 202, 202)'}}/> Start a New Conversation</div>
                    </div>
                    </div>

                </div>




            </div>

            </div>

            </div>


        )
    }

    export default BackCard
